import React, { Component } from "react";
import classes from "./Navbar.module.css";
import { Link } from "react-router-dom";
import SideNav, { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";
import "@trendmicro/react-sidenav/dist/react-sidenav.css";
import './Navbar.css';
import { withRouter } from "react-router-dom";
import Notifications from "../Notifications/Notifications";


class Navbar extends Component {
    constructor(props){
        super(props);

        this.state = {
            expanded: false
        }
    }
    closeMenu = () => {
        this.setState({
            expanded: false
        })
    }

    openMenu = (expanded)=> {
        this.setState({
            expanded: expanded
        })
    }
	render() {
        const { location, history } = this.props;

		return (
			<div className="container-nav">
				<div className={classes.Navbar}>
					<SideNav
					  onSelect={(selected) => {
                        const to = '/' + selected;
                        this.closeMenu();
                        if (location.pathname !== to) {
                            history.push(to);
                        }
                    }}
                    onToggle={this.openMenu}
                    expanded={this.state.expanded} 
					>

						<SideNav.Toggle expanded={this.state.expanded}  />
						<SideNav.Nav defaultSelected="home">

							<NavItem eventKey="charts">
								<NavIcon>
									<i
										className="fa fa-fw fa-line-chart"
										style={{ fontSize: "1.75em" }}
									/>
								</NavIcon>

								<NavText><Link to="/notifications">Notifications</Link></NavText>
							</NavItem>



							<NavItem eventKey="test">
								<NavIcon>
									<i
										className="fa fa-fw fa-line-chart"
										style={{ fontSize: "1.75em" }}
									/>
								</NavIcon>
								<NavText><Link to="/STAT">Notifications</Link></NavText>
							</NavItem>
							<NavItem eventKey="hello">
								<NavIcon>
									<i
										className="fa fa-fw fa-line-chart"
										style={{ fontSize: "1.75em" }}
									/>
								</NavIcon>
								<NavText>History</NavText>
							</NavItem>

							<NavItem eventKey="test2">
								<NavIcon>
									<i
										className="fa fa-fw fa-line-chart"
										style={{ fontSize: "1.75em" }}
									/>
								</NavIcon>
								<NavText>Suggest a product</NavText>
							</NavItem>

							<NavItem eventKey="testttt">
								<NavIcon>
									<i
										className="fa fa-fw fa-line-chart"
										style={{ fontSize: "1.75em" }}
									/>
								</NavIcon>
								<NavText>Contact us</NavText>
							</NavItem>
						</SideNav.Nav>
					</SideNav>
				</div>
			</div>
		);
	}
}
export default  withRouter(Navbar);
